exports=async function(bid,options){const{parseCatalogPaginate,selectIndexTotalPagesRegex}=await require("transcode/parse_catalog"),clientOptions={...(options&&options.clientOptions),"x-mobile":1};return parseCatalogPaginate(page=>`https://m.moyisy.com/book/${bid}/${1===page?"":"index_"+page+".html"}`,".section-list",{...options,clientOptions,pageSize:20,totalPagesRegex:selectIndexTotalPagesRegex})};